  state = {};
  render() {
    return (
      <div className="container">
        <PageHeader titleText="About Real App" />
        <div className="row">
          <div className="col-12">
            <div className="container">
              <h2>Ghaleb's Website</h2>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default About;
